import React from "react";
import "./home.css";

class Home extends React.Component {
  render() {
    return (
      <div className="PostBody">
        <button>Add Post</button>
        <div className="post">
          {this.props.posts.map(item => {
            return (
              <div key={this.props.posts.id}>
                <p>{item.title}</p>
                <p>{item.category}</p>
              </div>
            );
          })}
        </div>
      </div>
    );
  }
}

export default Home;
